def compute_streak(N):
	current_streak = 0
	max_streak = 0
	best_initial = N[0]
	init = N[0]
	for i in range(len(N) - 1):
		if N[i] + 1 == N[i + 1]:
			current_streak += 1
		elif current_streak > max_streak:
			best_initial = init 
			max_streak = current_streak
			initial = N[i + 1]
			current_streak = 0
	return best_initial, max_streak

